import React from "react";
import SimpleImageSlider from "react-simple-image-slider";
import ukelele from "../../../img/home/CourseCarousel/ukelele.png";

export default function CourseCarousel() {
  const images = [
    {
      url: ukelele,
    },
    {
      url: ukelele,
    },
  ];
  return (
    <div>
      <SimpleImageSlider width="100%" height={400} images={images} showBullets={true} showNavs={true} autoPlay={true} loop={true} />
    </div>
  );
}
